// frontend/src/pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50">
      <div className="text-center">
        <h1 className="text-4xl font-bold mb-8 text-gray-900">Welcome to Tracks</h1>
        <p className="text-xl text-gray-600 mb-8">Your SaaS platform for success</p>

        <div className="space-x-4">
          <Link
            to="/login"
            className="inline-block px-6 py-3 bg-indigo-600 text-white font-medium rounded-md hover:bg-indigo-700"
          >
            Sign In
          </Link>
          <Link
            to="/register"
            className="inline-block px-6 py-3 bg-gray-600 text-white font-medium rounded-md hover:bg-gray-700"
          >
            Create Account
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Home;
